const initialState = { promts: {} };
const reducer = (state = initialState, action) => {
    switch (action.type) {
        case 'SET_STATE_TO_PROMT':
            return {
                ...state,
                selectedEnnea: action.payload.selectedEnnea,
              };
        default:
            return state;
    }
}
export default reducer;
